import React from 'react'

const arr = ['ajay', 'ak', 'ak10'];
function Greet() {

    var n = document.getElementById('name').value;
    console.log(n)
    var list = arr.map((itm, k) => {
        return (<li>{itm}</li>)
    })
}
const Login = () => {

    return (
        <>
            <h1>Welcome to login Form</h1>
            <form>
                <input type='text' id='name' className='formControl' />
                <input type='text' id='number' />
                <button className='btn btn-outline-info' onClick={Greet}>Submit</button>
            </form>

        </>
    )
}

export default Login;
